Jak provést měření kyslíku v krvi:
1. Hodinky noste na šířku jednoho prstu pod zápěstní kostí a noste je v pohodlné poloze na zápěstí; 
2. Po vstupu do režimu detekce kyslíku v krvi zůstaňte v klidu, ujistěte se, že máte zápěstí v rovině a hodinky směřují vzhůru. Pokud sedíte, můžete si položit ruce na stůl tak, aby hodinky směřovaly nahoru; 
3. Udržujte prosím ruku v klidu, dokud nezískáte konečný výsledek. 
Upozorňujeme, že tato funkce je experimentální, hodnoty jsou pouze odhadovány a mohou se lišit od skutečnosti. Funkce není určena pro lékařské použití. V případě jakýchkoli dotazů ke zdravotnímu stavu se obraťte na odborníka nebo Vašeho lékaře.
